import { Sound } from "./sound.js";
import Tab from "react-bootstrap/Tab";
import Tabs from "react-bootstrap/Tabs";

const SoundBoard = ({ play, animalsounds, musicsounds, cartoonsounds }) => {
	return (
		<>
			<header>SoundPlate</header>
			<Tabs
				defaultActiveKey="home"
				id="tabs"
				className="tabcss opacity-75"
				justify
			>
				<Tab eventKey="home" title="Home">
					<p className="home-paragraph">
						Welcome to SoundPlate! <br />
						You can use this board to create an elegant symphony, pretend you're
						on a safari, or blame a gnarly fart on someone else.
						<br />
						There are plenty of sounds to feast upon, but be careful. Not all
						sounds are what they seem.
					</p>
				</Tab>
				<Tab eventKey="genre-1" title="Animal Plates">
					<center>
						{animalsounds.map((sound) => (
							<Sound play={play} sound={sound} />
						))}
					</center>
				</Tab>
				<Tab eventKey="genre-2" title="Music Plates">
					{musicsounds.map((sound) => (
						<Sound play={play} sound={sound} />
					))}
				</Tab>
				<Tab eventKey="genre-3" title="Cartoon Plates">
					{cartoonsounds.map((sound) => (
						<Sound play={play} sound={sound} />
					))}
				</Tab>
				<Tab eventKey="genre-4" title="Add Your Own Sound">
					<iframe
						title="soundForm"
						src="https://qfreeaccountssjc1.az1.qualtrics.com/jfe/form/SV_8zQVkI7L4EzHO0C"
						height="500px"
						width="600px"
					></iframe>
				</Tab>
			</Tabs>
		</>
	);
};

export { SoundBoard };
